  "in_reply_to_user_id" : 3119862113,
  "text" : "We both knew that the hope to meet again is nonexistent. After all, we\u2019re just cracks in the pavement. We are different pieces never to meet again, separated by memories shared.\n\nHe loved. I loved. That\u2019s enough. \n\nEND.",
