  "id_str" : "1117101798945202176",
  "in_reply_to_user_id" : 3119862113,
  "text" : "And in that moment, I knew he understood. The two worlds we try to merge together are falling apart. \n\nThis will be the last time.",
  "id" : 1117101798945202176,
  "in_reply_to_status_id" : 1117101797900832768,
  "created_at" : "2019-04-13 16:26:38 +0000",
