  "id_str" : "1117101799796658177",
  "in_reply_to_user_id" : 3119862113,
  "text" : "I don\u2019t know if it was his tears or mine that started to fall between us. But as the river of our emotions cascades down our cheeks, he released me. I was afraid to open my eyes. I fear the emotion I may see in his eyes. I never stood a chance against his misery.",
  "id" : 1117101799796658177,
  "in_reply_to_status_id" : 1117101798945202176,
