  "id_str" : "1117101800711000066",
  "in_reply_to_user_id" : 3119862113,
  "text" : "A pause. A momentary silence signifying a forked road. This or that. The life was taken out of me as the sound of his decision resonates in my ears \u2014 his footsteps.",
