  "text" : "Hanbin: We can work this out. I\u2019ll make time for you this time. Just\u2014\n\nReader: I know. But I\u2019m not ready.\n \nHanbin: ready for what?\n\nReader: I\u2019m not ready to be the reason for you to sacrifice your dreams. I\u2019m not ready for you to hate me. I don\u2019t wa\u2014\n\nHanbin: I pro-",
