  "text" : "What did they do to perfect each stage? What did they do to remain together all these years? \n\nFrom talent, emotions, &amp; motivations, iKON can provide them all. It's so fucking clear that for iKON, this is an honour. They must've felt amazing seeing these people perform for them.",
