  "id_str" : "1114180603635802112",
  "in_reply_to_user_id" : 3119862113,
  "text" : "\"I love you to death but at the end, I didn't die.\" - HANBIN\n\nThe words from this line is so simple. But the gravity of the meaning hits you a tenfold. Hanbin has the ability to give words to feelings we can't comprehend. His lyrics is also his narrative.",
  "id" : 1114180603635802112,
  "in_reply_to_status_id" : 1114180602713051138,
  "created_at" : "2019-04-05 14:58:51 +0000",
