  "geo" : { },
  "id_str" : "1114180604508217345",
  "in_reply_to_user_id" : 3119862113,
  "text" : "Even their most hyped up songs have well-thought out substantial lyrics. Hanbin &amp; Bobby both deviate away from trashy and disrespectful lyrics even if the lyrics portray self-hype. Take B-DAY and BLING BLING for example. It's so self-centred but it doesn't make you cringe at all.",
  "id" : 1114180604508217345,
  "in_reply_to_status_id" : 1114180603635802112,
  "created_at" : "2019-04-05 14:58:51 +0000",
