  "geo" : { },
  "id_str" : "1114180605443563520",
  "in_reply_to_user_id" : 3119862113,
  "text" : "At this point, I think GD's and Tablo's works are very self-explanatory. Their discography speaks true to their craft. \n\nHYUKOH is also someone to look out for. Check out their songs.",
  "id" : 1114180605443563520,
