  "geo" : { },
  "id_str" : "1114180601710546944",
  "in_reply_to_user_id" : 3119862113,
  "text" : "Why? There are lyricists whose words become extensions of their being and there are those who write lyrics just for the sake of it. Hanbin, Tablo and GD pulls words from their life experiences and people they interact with.",
  "id" : 1114180601710546944,
  "in_reply_to_status_id" : 1114153679370641409,
